  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  WMD outlines District accomplishments during the 1980 calendar year. The report
  begins with an introduction to the WMD and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction
  and maintenance are also described. Habitat management is covered; grasslands, wetlands,
  and easements for waterfowl management are discussed. The wildlife section of the
  report discusses endangered and threatened species, migratory birds, mammals, and
  non-migratory birds. Interpretation and recreation activities are outlined; topics
  include recreation. Items of interest are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
